import React, {Component} from 'react'

class Item extends Component {

    constructor() {
        super();
    }

    render() {
        return (
            <div>
                <h2>{this.props.itemName}</h2>
                <h3>{this.props.price}</h3>
            </div>
        )
    }
}

export default Item
